CombatScripts\Runtime void OnAttributeChanged(AttributeChangeEventArgs Args)
{
 if (Args == null)
 return;

 if (Mathf.RoundToInt(Args.Attribute.Value) < 0)
 {
 _isDeath = true;
 return;
 }

 if (_isDeath == true && Mathf.RoundToInt(Args.Attribute.Value) > 0)
 {
 _entityStateEventPublisher.Publish(new CombatEntityStateChange(Enums.CombatEntityStateChange _attacker, _damage));
 }
}
